  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
  background-color: black;
  animation: mymove 1s linear infinite;
`

export const Wrapper = styled.div`
	display: flex;
`
export const Inner = styled.div`
  width: 20px;
  height: 20px;
  margin: 10px;
  border-radius: 10px;
  background: red;
  position: relative;
`

